    msg = b''
    try:
        msg = self.channel.recv(512)
    except SocketTimeout:
        raise SCPException('Timeout waiting for scp response')
    # slice off the first byte, so this compare will work in py2 and py3
    if msg and msg[0:1] == b'\x00':
