public function handle($request, Closure $next)
    {
        if (! $this->verifySignature($request)) {
            abort(401);
        }
        return $next($request);
    }

private function verifySignature($request)
    {
        $url = $request->fullUrl();
        $url = strtok($url, "?");
        $body = $request->getContent();
        $data = $body.$url;
        $hmac = base64_encode(hash_hmac('sha1', $data, APP_SECRET, true));
        return $request->header('X-Signature') == $hmac;
    }

